import React from 'react';
import '../App.css';

const WelcomePage = () => {
  return (
    <div id="welcome-section" class="welcome-section">
      <h1>Welcome to My Portfolio!</h1>
      <p>Thank you for visiting my portfolio website. Feel free to explore and learn more about me and my work.</p>
    </div>
  );
};

export default WelcomePage;
